import React, { FunctionComponent, useState, useEffect } from "react";
import Pokemon from "./models/pokemon";
import { POKEMONS } from "./models/mocks-pokemon";

const App: FunctionComponent = () => {
  const [pokemon, getPokemon] = useState<Pokemon[]>([]);

  useEffect(() => {
    getPokemon(POKEMONS);
  }, []);

  const showPokemonCount = () => {
    console.log(pokemon.length);
  };

  return (
    <div>
      <h1 class="center">Pokedex</h1>
      <p onClick={showPokemonCount}>Afficher le nombre de pokemon</p>
    </div>
  );
}

export default App;
